import React from "react";
import "../styles/ourServices.css";
import Desktop from "../resource/desktop.svg";
import Basket from "../resource/basket.svg";
import Graph from "../resource/graph.svg";
import Lightbulb from "../resource/lightbulb.svg";
import Pen from "../resource/pen.svg";
import Strategy from "../resource/strategy.svg";
import {servicesContentData} from "../actions/servicesAC";
import {connect} from "react-redux"
import {teamContentData} from "../actions/teamAC";

class OurServices extends React.Component{
    componentDidMount() {
        this.props.fetchData("http://localhost/backend/team.php");
    }
    render() {
        return (
            <div className="servicesContent" id="services">
                <h1>OUR SERVCIES</h1>
                <div className="servicesContext">
                    <hr/>
                    <h6>There is magic in what we do</h6>
                    <hr/>
                </div>
                <div className="serviceList">
                    <div>
                        <img src={Strategy} alt="img"/>
                        <h3>Branding</h3>
                        <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                            mei ludus efficiendi ei. Sea summo mazim<br/>
                            ex, ea errem eleifend definitionem vim</h6>
                    </div>
                    <div>
                        <img src={Lightbulb} alt="img"/>
                        <h3>Marketing</h3>
                        <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                            mei ludus efficiendi ei. Sea summo mazim<br/>
                            ex, ea errem eleifend definitionem vim</h6>
                    </div>
                    <div>
                        <img src={Desktop} alt="img"/>
                        <h3>Development</h3>
                        <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                            mei ludus efficiendi ei. Sea summo mazim<br/>
                            ex, ea errem eleifend definitionem vim</h6>
                    </div>
                    <div>
                        <img src={Pen} alt="img"/>
                        <h3>Web Design</h3>
                        <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                            mei ludus efficiendi ei. Sea summo mazim<br/>
                            ex, ea errem eleifend definitionem vim</h6>
                    </div>
                    <div>
                        <img src={Graph} alt="img"/>
                        <h3>Social Media</h3>
                        <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                            mei ludus efficiendi ei. Sea summo mazim<br/>
                            ex, ea errem eleifend definitionem vim</h6>
                    </div>
                    <div>
                        <img src={Basket} alt="img"/>
                        <h3>Ecommerce</h3>
                        <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                            mei ludus efficiendi ei. Sea summo mazim<br/>
                            ex, ea errem eleifend definitionem vim</h6>
                    </div>
                </div>
            </div>
        )
    }
}
const mapStateToProps = state => ({
    services: state.services,
    title: state.header
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(servicesContentData(url))
});
export default connect(mapStateToProps, mapDispatchToProps)(OurServices)
